import React, {Component} from 'react';

class Auth extends Component {
	state = {};
	render() {
		return (
			<div>
				<form>
					<label>Enter username</label>
					<input onChange={this.handleChange} />
				</form>
			</div>
		);
  }
  handleChange = (event) => {}
}

export default Auth;
